import React from 'react'

const EmployeeList = (props) => {
    const {empData} = props;
    console.log(empData)

  return (
    <div>
        <ol>
            { empData?.map((value, index)=>(
                <li key={index}>
                    {value.fullName}
                </li>
                ))}
        </ol>
    </div>
  )
}

export default EmployeeList
